    [],nt"revision_timestamp": "2015-07-23T03:27:42.799422",nt"name": "oregon-high-desert-discovery-an-overview",nt"isopen":
    false,nt"url": null,nt"notes": "This is a plan to link five BLM and FWS
    areas in southeast Oregon in order to provide better services for visitors. In order
    to most effectively and efficiently serve visitors in this region, the BLM and FWS
    have developed the Oregon High Desert Discovery to link five areas: Malheur National
    Wildlife Refuge, Steens Mountain, Diamond Craters Outstanding Natural Area, Hart
    Mountain National Antelope Refuge, and Warner Wetlands Area of Critical Environmental
    Concern. The plan has been designed to guide, inform, and provide services for visitors
    in this remote region of southeastern Oregon.",nt"license_title": "License
